import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'

function Test() {
    return (
        <div class="box">
            <div>Stuff</div>
            <div>more stuff</div>
        </div>
    )
}

ReactDOM.render(
    <Test />,
    document.getElementById('root')
)
